import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the product cards to be dynamically rendered by the script
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Take a screenshot after products are loaded
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_products_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_products_loaded.png'));

    // Use a locator for all product price elements
    const priceLocator = page.locator('.product-price');

    // Extract the text from all price elements using evaluateAll
    const allPrices = await priceLocator.evaluateAll(elements =>
      elements.map(el => {
        // The innerText can contain both the sale price and the original price separated by a newline.
        // We split by whitespace/newline and take the first part.
        const priceText = el.innerText.trim();
        return priceText.split(/[\s\n]/)[0];
      })
    );

    // Filter out any potentially empty or invalid results
    const cleanedPrices = allPrices.filter(price => price && price.startsWith('$'));

    return {
      success: true,
      action: "Successfully extracted all product prices from the page.",
      extractedData: {
        prices: cleanedPrices,
        count: cleanedPrices.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
